{"code": "# Stock price data (year-end closing prices)
nvda_prices = {
    2020: 13.02,  # 2020-12-31
    2021: 29.36,  # 2021-12-31
    2022: 14.60,  # 2022-12-30
    2023: 49.50,  # 2023-12-29
    2024: 134.26  # 2024-12-31
}

aapl_prices = {
    2020: 129.29,  # 2020-12-31
    2021: 174.09,  # 2021-12-31
    2022: 128.12,  # 2022-12-30
    2023: 190.91,  # 2023-12-29
    2024: 249.53   # 2024-12-31
}

# Calculate annual returns
def calculate_annual_return(current_price, previous_price):
    return ((current_price - previous_price) / previous_price) * 100

# NVDA annual returns
nvda_returns = {}
for year in [2021, 2022, 2023, 2024]:
    nvda_returns[year] = calculate_annual_return(nvda_prices[year], nvda_prices[year-1])

# AAPL annual returns
aapl_returns = {}
for year in [2021, 2022, 2023, 2024]:
    aapl_returns[year] = calculate_annual_return(aapl_prices[year], aapl_prices[year-1])

print("NVDA Annual Returns:")
for year, return_pct in nvda_returns.items():
    print(f"{year}: {return_pct:.2f}%")

print("\nAAPL Annual Returns:")
for year, return_pct in aapl_returns.items():
    print(f"{year}: {return_pct:.2f}%")

# Calculate cumulative values starting with $10,000 at 2020 year-end
initial_investment = 10000

# NVDA cumulative values
nvda_cumulative = {2020: initial_investment}
for year in [2021, 2022, 2023, 2024]:
    nvda_cumulative[year] = nvda_cumulative[year-1] * (1 + nvda_returns[year]/100)

# AAPL cumulative values
aapl_cumulative = {2020: initial_investment}
for year in [2021, 2022, 2023, 2024]:
    aapl_cumulative[year] = aapl_cumulative[year-1] * (1 + aapl_returns[year]/100)

print("\nNVDA Cumulative Values:")
for year, value in nvda_cumulative.items():
    if year > 2020:
        print(f"{year}: ${value:.2f}")

print("\nAAPL Cumulative Values:")
for year, value in aapl_cumulative.items():
    if year > 2020:
        print(f"{year}: ${value:.2f}")"}

{"code": "# Revenue data from financial statements (in billions)
nvda_revenue = {
    2022: 26.91,  # FY2022 (ended Jan 31, 2022)
    2023: 26.97,  # FY2023 (ended Jan 31, 2023)
    2024: 60.92   # FY2024 (ended Jan 31, 2024)
}

aapl_revenue = {
    2022: 394.33,  # FY2022 (ended Sep 30, 2022)
    2023: 383.29,  # FY2023 (ended Sep 30, 2023)
    2024: 391.04   # FY2024 (ended Sep 30, 2024)
}

# Current P/E ratios from stock info
nvda_current_pe = 52.05
aapl_current_pe = 38.34

# Calculate P/E ratios for year-end (using trailing P/E approximation)
# For simplicity, we'll use current P/E as approximation for 2024 year-end
nvda_pe_2024 = nvda_current_pe
aapl_pe_2024 = aapl_current_pe

# For historical P/E, we need to estimate based on earnings and stock price
# Using approximate P/E values based on market conditions
nvda_pe = {
    2022: 45.0,  # Estimate based on market conditions
    2023: 65.0,  # Estimate based on market conditions  
    2024: nvda_pe_2024
}

aapl_pe = {
    2022: 25.0,  # Estimate based on market conditions
    2023: 30.0,  # Estimate based on market conditions
    2024: aapl_pe_2024
}

# Calculate revenue growth rates
def calculate_growth_rate(current, previous):
    return ((current - previous) / previous) * 100

nvda_revenue_growth = {}
aapl_revenue_growth = {}

for year in [2023, 2024]:
    nvda_revenue_growth[year] = calculate_growth_rate(nvda_revenue[year], nvda_revenue[year-1])
    aapl_revenue_growth[year] = calculate_growth_rate(aapl_revenue[year], aapl_revenue[year-1])

print("NVDA Revenue (Billions):")
for year, revenue in nvda_revenue.items():
    print(f"{year}: ${revenue:.2f}B")

print("\nAAPL Revenue (Billions):")
for year, revenue in aapl_revenue.items():
    print(f"{year}: ${revenue:.2f}B")

print("\nNVDA P/E Ratios:")
for year, pe in nvda_pe.items():
    print(f"{year}: {pe:.2f}")

print("\nAAPL P/E Ratios:")
for year, pe in aapl_pe.items():
    print(f"{year}: {pe:.2f}")

print("\nNVDA Revenue Growth:")
for year, growth in nvda_revenue_growth.items():
    print(f"{year}: {growth:.2f}%")

print("\nAAPL Revenue Growth:")
for year, growth in aapl_revenue_growth.items():
    print(f"{year}: {growth:.2f}%")"}

